// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0 <0.9.0;

contract FRC {
    struct Scouter {
        uint teamNum;
        uint matchNum;
    }
    
    struct ScoutData {
        uint robotNum;
        uint points;
        string report;
        bool win;
    }
    
    Scouter[] public scouters;
    ScoutData[] public scoutData;
    
    function addScouter(uint _teamNum, uint _matchNum) public {
        Scouter memory newScouter = Scouter(_teamNum, _matchNum);
        scouters.push(newScouter);
    }
    
    function addScoutData(uint _robotNum, uint _points, string memory _report, bool _win) public {
        ScoutData memory newScoutData = ScoutData(_robotNum, _points, _report, _win);
        scoutData.push(newScoutData);
    }
    
    function getScoutData(uint256 index) public view returns (uint, uint, string memory, bool) {
        require(index < scoutData.length, "Invalid index");
        ScoutData memory scout = scoutData[index];
        return (scout.robotNum, scout.points, scout.report, scout.win);
    }
}
